<script>
import Footer from './Footer.vue';
import Navbar from './Navbar.vue';
import axios from '../axios';
import constants from '../../constant';

export default {
    name: 'New Landing',
    components: {
        Navbar,
        Footer
    },
    data() {
        return {
            formData: {
                email: '',
            },
        };
    },
    mounted() {
        window.addEventListener('message', (event) => {
            if (event.data === 'loginSuccess') {
                console.log(this.$store.state.auth.loggedIn, 'loggedIn');
                this.$store.dispatch('auth/fetched');
                this.$acl.change('user');
                this.$store.commit('auth/SET_LOGGEDIN', true);
                this.$router.push('/dashboard');
                this.url = '';
            }
        });
    },
    methods: {
        open() {
            window.open(constants.challengeUri, '_blank', 'width=600,height=600');
            // window.addEventListener('message', this.handleMessage, false);
        },
        // handleMessage(event) {
        //     if (event.data === 'loginSuccess') {
        //         window.location.reload();
        //     }
        // },
        handleButtonClick() {
            const userInfo = localStorage.getItem('userInfo');
            const accessToken = localStorage.getItem('accessToken');
            if (userInfo && accessToken) {
                this.$router.push('/dashboard');
            } else {
                this.open();
            }
        },
        async sendMessage() {
            if (
                !this.formData.email
            ) {
                this.$vs.notify({
                    title: 'Error',
                    text: 'Basic fields are mandatory',
                    color: 'danger',
                });
                return;
            }
            const emailPattern = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
            if (!emailPattern.test(this.formData.email)) {
                this.$vs.notify({
                    title: 'Error',
                    text: 'Incorrect email',
                    color: 'danger',
                });
                return;
            }
            try {
                const response = await axios.post(
                    constants.apiCastUrl + "/api/contact_us/",
                    this.formData
                );
                this.$vs.notify({
                    title: 'Successful',
                    text: 'Response recieved',
                    color: 'success',
                });
                this.resetForm();
            } catch (error) {
                this.$vs.notify({
                    title: 'Error',
                    text: 'Try again',
                    color: 'danger',
                });
                console.error('Error sending message:', error);
            }
        },
        resetForm() {
            this.formData.email = '';
        },
    },
}
</script>

